package com.example.lalafoapplication

import android.os.Bundle
import android.view.LayoutInflater
import android.view.View
import android.view.ViewGroup
import androidx.fragment.app.Fragment
import com.bumptech.glide.Glide
import com.example.lalafoapplication.databinding.FragmentDetailBinding

class DetailFragment : Fragment() {

    private lateinit var binding: FragmentDetailBinding
    private val cars = ArrayList<Pair<String, String>>()

    override fun onCreateView(
        inflater: LayoutInflater, container: ViewGroup?,
        savedInstanceState: Bundle?
    ): View? {
        binding = FragmentDetailBinding.inflate(inflater, container, false)
        return binding.root
    }

    override fun onViewCreated(view: View, savedInstanceState: Bundle?) {
        super.onViewCreated(view, savedInstanceState)

        val carCategory = arguments?.getString("Key") ?: return
        position(carCategory)

        val casAdapter = CarsAdapter(cars) { carName, imageUrl ->
            val newFragment = DescriptionFragment().apply {
                arguments = Bundle().apply {
                    putString("carName", carName)
                    putString("imageUrl", imageUrl)
                }
            }
            parentFragmentManager.beginTransaction()
                .replace(R.id.fragment_container, newFragment)
                .addToBackStack(null)
                .commit()
        }

        binding.rvCar.adapter = casAdapter
        casAdapter.notifyDataSetChanged()
    }

    private fun position(cont: String) {
        cars.clear()
        when (cont) {
            "BMW" -> {
                cars.add(Pair("M8", "data:image/jpeg;base64,"))
                cars.add(Pair("X6", "data:image/jpeg;base64,"))
                cars.add(Pair("X4", "data:image/jpeg;base64,"))
                cars.add(Pair("X2", "data:image/jpeg;base64,"))
            }
            "Mercedes" -> {
                cars.add(Pair("X5", "data:image/jpeg;base64,"))
                cars.add(Pair("X55", "data:image/jpeg;base64,"))
                cars.add(Pair("X7", "data:image/jpeg;base64,"))
                cars.add(Pair("X6", "data:image/jpeg;base64,"))
            }
            "Toyota" -> {
                cars.add(Pair("Supra", "data:image/jpeg;base64,"))
                cars.add(Pair("Brevis", "data:image/jpeg;base64,"))
                cars.add(Pair("Xd", "data:image/jpeg;base64,"))
                cars.add(Pair("Xr", "data:image/jpeg;base64,"))
            }

        }
    }
}
